import React, { useState } from "react";

import ColorLogo from "../Assets/Color logo.png";

const Sidebar = () => {
  const [open, setOpen] = useState(false);

  const handleToggle = () => setOpen(!open);

  return (
    <div class="container">
      <div class="row">
        <div class="col-1">.col-9</div>
      </div>
    </div>
  );
};

export default Sidebar;
